export default function guardrail(mathFunction) {
  const queue = [];
  try {
    const mathResult = mathFunction();	  
    queue.push(mathResult);
  } catch (err) {
    queue.push(String(err.message));
  } finally {
    queue.push('Guardrail was processed');
  }
  return queue;
};
